// App.js

// Remove the import if Header is not intended to be used
// import Header from './components/Header';

import React, { useState } from 'react';
import Home from './components/Home';
import Products from './components/Products';
import Product1 from './components/Product1'; // Import product detail components as needed
import './App.css';

function App() {
  const [currentPage, setCurrentPage] = useState('home'); // State to manage current page

  const navigateTo = (page) => {
    setCurrentPage(page);
  };

  return (
    <div className="App">
      {/* If not using Header, remove this */}
      {/* <Header navigateTo={navigateTo} /> */}
      {currentPage === 'home' && <Home navigateTo={navigateTo} />}
      {currentPage === 'products' && <Products navigateTo={navigateTo} />}
      {currentPage === 'product1' && <Product1 navigateTo={navigateTo} />}
      {/* Add more product detail pages as needed */}
    </div>
  );
}

export default App;
